import React from "react";

const BinanceTable = ({ item }) => {
  return (
    <div
      style={{
        height: "50%",
        width: "75%",
        display: "flex",
        alignItems: "center",
        justifyContent: "center",
      }}
    >
      <div
        style={{
          height: 269,
          width: 800,
          background: "white",
          borderRadius: 10,
          display: "flex",
          boxShadow:
            "rgba(0, 0, 0, 0.07) 0px 1px 2px, rgba(0, 0, 0, 0.07) 0px 2px 4px, rgba(0, 0, 0, 0.07) 0px 4px 8px, rgba(0, 0, 0, 0.07) 0px 8px 16px, rgba(0, 0, 0, 0.07) 0px 16px 32px, rgba(0, 0, 0, 0.07) 0px 32px 64px",
        }}
      >
        <div
          style={{
            height: "100%",
            width: "50%",
            background: "red",
            display: "flex",
            alignItems: "center",
            justifyContent: "center",
          }}
        >
          <div
            style={{ height: "95%", width: "95%", background: "white" }}
          ></div>
        </div>
        <div style={{ height: "100%", width: "50%", background: "green" }}>
          {" "}
          <div style={{ height: "15%", width: "30%", background: "white" }}>
            {item.name}
          </div>
        </div>
      </div>
    </div>
  );
};

export default BinanceTable;
